import brand_img1 from './brand1.jpg'
import brand_img2 from './brand2.jpg'
import brand_img3 from './brand3.jpg'
import brand_img4 from './brand4.jpg'
import brand_img5 from './brand5.jpg'
import brand_img6 from './brand6.jpg'
import brand_img7 from './brand7.jpg'
import brand_img8 from './brand8.jpg'

let data_brands = [
    {
        id: 1,
        image: brand_img1,
    },
    {
        id: 2,
        image: brand_img2,
    },
    {
        id: 3,
        image: brand_img3,
    },
    {
        id: 4,
        image: brand_img4,
    },
    {
        id: 5,
        image: brand_img5,
    },
    {
        id: 6,
        image: brand_img6,
    },
    {
        id: 7,
        image: brand_img7,
    },
    {
        id: 8,
        image: brand_img8,
    },
];

export default data_brands;
